export default class LoginVO {
    private _id:string;
    private _password :string;
    
    constructor(obj) {
        Object.assign(this, obj)
    }

    /**
     * Getter $id
     * @return {string}
     */
	public get id(): string {
		return this._id;
	}

    /**
     * Getter $password
     * @return {string}
     */
	public get password(): string {
		return this._password;
	}
}
